import React, { Component, Fragment } from 'react'
import ReviewForm from './ReviewForm'

class RestaurantInfo extends Component {


    render() {
        console.log(this.props.currentCard.result)
        return (
            <Fragment>
              <h1>{this.props.currentCard.result.name}</h1>
              <h2>{this.props.currentCard.result.price_level}</h2>
              <h2>{this.props.currentCard.result.rating}</h2>
              <h3>{this.props.currentCard.result.formatted_address}</h3>
              <h3>{this.props.currentCard.result.formatted_phone_number}</h3>
              <h3>{this.props.currentCard.result.website}</h3>
              <h4>{this.props.currentCard.result.opening_hours.weekday_text}</h4>
            </Fragment>
        )
    }
}

export default RestaurantInfo
